            <section class="container">

                <form id="my-formDoc">
                    <h1>Log in</h1>
                    <div>
                        <label for="MedicalNum">Medical Liscence Number</label>
                        <input type="text" id="emailDoc">
                    </div>
                    <div>
                        <label for="Password">password</label>
                        <input type="password" id="PasswordDoc">
                        <input type="button" id="showButtonDoc" value="show" onclick="toggleButton()">
                    </div>
                    <input class="btn" type="button" value="login" onclick="DocValidation(document.getElementById('emailDoc').value, document.getElementById('PasswordDoc').value)">
                </form>
        </div>
    

    <script>
        

        function setCookies(){
            
            if(document.cookie.length!=0){
                var arr = document.cookie.split(";");
                arrUname = arr[0].split("=");
                arrPwd = arr[1].split("=");
                console.log("username: "+arrUname[1]+"pwd: "+arrPwd[1]);
                document.getElementById('email').value=arrUname[1];
                document.getElementById('Password').value=arrPwd[1];

            }
        }

        function PetParentValidation(username, password){
            const users = [
                {
                    email:'alby@gmail.com',
                    password:'alby1234'
                },
                {
                    email:'benet@gmail.com',
                    password:'benet1234'
                },
                {
                    email:'cathy@gmail.com',
                    password:'cathy'
                }

            ];
    
                flag = false;
            for(i=0;i<users.length;i++){
                if(users[i].email==username && users[i].password==password){
                    flag = true;
                }
            }
            

            switch(flag){
                case true:
                document.cookie = 'username='+username;
                document.cookie = 'pwd='+password;
                console.log(document.cookie);
                window.location.href = "main.php";
                break;

                case false:
                alert("invalid email or password!")
                break;    
            }
        }

        function DocValidation(Liscence, password){
            const users = [
                {
                    num:1000001,
                    password:'alby1234'
                },
                {
                    num:1000002,
                    password:'benet1234'
                },
                {
                    num:1000003,
                    password:'cathy'
                }

            ];
                
                flag = false;
                i = 0;
                while(i<users.length){
                    if(users[i].num==Liscence && users[i].password==password){
                    flag = true;
                }
                i++;
                }

                switch(flag){
                case true:
                window.location.href = "main.html";
                break;

                case false:
                alert("invalid liscence or password!");
                break;    
            }
        
        }

        function toggleButton() {
            var passwordField = document.getElementById('Password');
            var passwordFieldDocs = document.getElementById('PasswordDoc');
            var sBtnpp = document.getElementById('showButton');
            var sBtnDoc = document.getElementById('showButtonDoc');
            if(passwordField.type === "password" || passwordFieldDocs.type === "password"){
                passwordField.type = "text";
                passwordFieldDocs.type = "text";
                sBtnpp.value="hide";
                sBtnDoc.value="show";

            }else{
                passwordField.type = "password";
                passwordFieldDocs.type = "password";
                sBtnpp.value="show";
                sBtnDoc.value="hide";
            }
        }

        function DisplayPetParentPage() {
            PetParent.style.display="block";
            Doc.style.animation = "OpDownAnime 0.5s linear forwards";
            PetParent.style.animation = "OpUpAnime 0.5s linear forwards";
            Doc.style.display = "none";
            
            

        }

        function DisplayDocPage() {
            PetParent.style.animation = "OpDownAnime 0.5s linear forwards";
            PetParent.style.display="none";
            Doc.style.animation = "OpUpAnime 0.5s linear forwards";
            Doc.style.display = "block";
            
            

        }
    </script>
